import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input using placeholder attribute
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Focus and type a partial search term to trigger autocomplete
    const searchInput = await page.$('input[placeholder="Search Amazon"]');
    await searchInput.focus();
    await searchInput.type('iph', { delay: 100 });

    // Wait for the suggestions dropdown to appear using its class
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_suggestions.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_suggestions.png'));

    // Extract suggestion texts using suggestion-item class
    const suggestionItems = await page.$$eval('.suggestion-item', els => els.map(e => e.textContent.trim()));

    // Click the first suggestion using nth-child selector
    if (suggestionItems.length > 0) {
      await page.click('.suggestion-item:nth-child(1)');
    }

    // Wait for search results header to show the search term
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_results.png'));

    // Extract the number of results from the .results-count element
    let resultsCountText = '';
    try {
      resultsCountText = await page.$eval('.results-count', el => el.textContent.trim());
    } catch (e) {
      resultsCountText = '';
    }

    // Extract the titles of the first 3 products in the results using .product-title
    let productTitles = [];
    try {
      productTitles = await page.$$eval('.products-grid .product-title', els => els.slice(0,3).map(e => e.textContent.trim()));
    } catch (e) {
      productTitles = [];
    }

    return {
      success: true,
      action: "Tested search autocomplete: triggered suggestions, selected a suggestion, verified search results.",
      extractedData: {
        suggestions: suggestionItems,
        resultsCount: resultsCountText,
        topProductTitles: productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
